                    <div class="container">
<div class="row">
<div class="col-md-12" data-aos="fade-up" data-aos-offset="300" data-aos-easing="ease-in-sine" data-aos-duration="1500">
<div style="text-align: center;">
<h2 style="font-size: 32px; margin: 0; letter-spacing: 2px; font-weight: 300;">FAQs</h2>
<div class="separator">&nbsp;</div>
</div>
<div id="accordion" class="panel-group" role="tablist" aria-multiselectable="true">
<div class="panel panel-default">
<div id="headingOne" class="panel-heading" role="tab">
<h4 class="panel-title"><a class="" href="#collapseOne" data-toggle="collapse" data-parent="#accordion" aria-expanded="true" aria-controls="collapseOne"> What kind of Interior fit outs are done by Winteriors Decor? </a></h4>
</div>
<div id="collapseOne" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="headingOne" aria-expanded="true">
<div class="panel-body">
<p>Winteriors Decor is a leading interior design company providing turnkey commercial interior designs and build projects since 2008. At Winteriors, we are providing a full scope interior design solution as per our clients requirements. It's been more than a decade that we are into this industry and we use our expertise to deliver stunning interiors.</p>
<p>Winteriors Decor LLC - Creating Spaces that are a Joy to work in!</p>
</div>
</div>
</div>
<div class="panel panel-default">
<div id="headingTwo" class="panel-heading" role="tab">
<h4 class="panel-title"><a class="collapsed" href="#collapseTwo" data-toggle="collapse" data-parent="#accordion" aria-expanded="false" aria-controls="collapseTwo"> How many years of experience do Winteriors Decor LLC have? </a></h4>
</div>
<div id="collapseTwo" class="panel-collapse collapse" style="height: 0px;" role="tabpanel" aria-labelledby="headingTwo" aria-expanded="false">
<div class="panel-body">
<h4 style="color: #c762cb;">15 Years of Excellence:</h4>
<p>Winteriors Decor LLC have been delivering high quality sustainable interior solutions since 2008.With the rich history of excellence for 15 long years, we have made a strong expertise to create spaces that boundlessly blend aesthetics and functionality.</p>
</div>
</div>
</div>
<div class="panel panel-default">
<div id="headingThree" class="panel-heading" role="tab">
<h4 class="panel-title"><a class="collapsed" href="#collapseThree" data-toggle="collapse" data-parent="#accordion" aria-expanded="false" aria-controls="collapseThree"> What will our project cost? </a></h4>
</div>
<div id="collapseThree" class="panel-collapse collapse" role="tabpanel" aria-labelledby="headingThree" aria-expanded="false">
<div class="panel-body">
<p>It greatly depends on the level of project you plan to have. If you have a budget in mind for your project, we will definitely take it into consideration while preparing the scope of work and the design fee for your project. But we could ensure that we would perfectly utilize your budget to deliver the best possible and top notch interiors.</p>
</div>
</div>
</div>
<div class="panel panel-default">
<div id="headingFour" class="panel-heading" role="tab">
<h4 class="panel-title"><a class="collapsed" href="#collapseFour" data-toggle="collapse" data-parent="#accordion" aria-expanded="false" aria-controls="collapseFour"> Where are the Winteriors located? </a></h4>
</div>
<div id="collapseFour" class="panel-collapse collapse" role="tabpanel" aria-labelledby="headingFour" aria-expanded="false">
<div class="panel-body">
<p>Winteriors Decor LLC has two locations:</p>
<ul>
<li>Dubai - Office no. 1706, Concord Tower, Dubai Media City, Dubai, UAE, P.O. Box: 643859</li>
<li>Abu Dhabi - Office no. M04, Ahmed Abdulla Alhameli Building,Salam street, Abu Dhabi, UAE, P.O. Box: 128841</li>
</ul>
</div>
</div>
</div>
<div class="panel panel-default">
<div id="headingFive" class="panel-heading" role="tab">
<h4 class="panel-title"><a class="collapsed" href="#collapseFive" data-toggle="collapse" data-parent="#accordion" aria-expanded="false" aria-controls="collapseFive"> Why should I hire an Interior Designer? </a></h4>
</div>
<div id="collapseFive" class="panel-collapse collapse" role="tabpanel" aria-labelledby="headingFive" aria-expanded="false">
<div class="panel-body">
<p>There are multiple factors as to why you should hire an interior designer and not do it by yourself. Hiring an interior designer helps you in saving your valuable resources like time, money and so on. In addition it helps in using the expertise of the designer as they are specialized in the field.</p>
<p>When you hire Winteriors Decor LLC, we ensure that the best possible interior solutions are provided to you. From analyzing the entire space, providing an extraordinary designing solution, shopping for the essentials to finally executing the entire plan we will take care of everything.</p>
</div>
</div>
</div>
</div>
</div>
</div>
</div>
