<script>
$(document).ready(function(){
   
    // Define the old domains
    var oldDomain1 = 'https://www.winterior.whserver.in';
    var oldDomain2 = 'www.winterior.whserver.in';
    var oldDomain3 = 'https://winterior.whserver.in';
    var newDomain = window.location.origin;

    // Iterate over all anchor tags on the page
    $('a').each(function(){
        var href = $(this).attr('href');
        if(href) {
            // Remove .html from the URL
            href = href.replace(/\.html$/, '');

            // Replace occurrences of old domains with new domain
            href = href.replace(new RegExp(oldDomain1, 'g'), newDomain);
            href = href.replace(new RegExp(oldDomain2, 'g'), newDomain);
            href = href.replace(new RegExp(oldDomain3, 'g'), newDomain);
            
            $(this).attr('href', href);
        }
    });
    
});
</script>

<script type="text/javascript">
    $(document).ready(function() {
        $(window).on("scroll", function() {
            myFunction();
        });

        function myFunction() {
            var header = $("header");
            var sticky = header.offset().top;

            if ($(window).scrollTop() >= 100) {
                header.addClass("sticky");
            } else {
                header.removeClass("sticky");
            }
        }
    });
</script>

    <script type="text/javascript">
        window.onscroll = function () {
            myFunction()
        };
        var header = document.getElementsByTagName("header")[0];
        var sticky = header.offsetTop;

        function myFunction() {
            if (window.pageYOffset >= sticky) {
                header.classList.add("sticky");
            } else {
                header.classList.remove("sticky");
            }
        }
    </script>
